import React from 'react'

function Nav() {
    return (
        <div className="navbar">
            <div className="nav_content">
                <img className="nav_avatar" src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png" alt=""/>
            </div>
            
        </div>
    )
}

export default Nav
